import React, { Component, Button } from "react";
import "./Training.css";
import { } from 'react-bootstrap';

export default class Training extends Component {  
  constructor(props) {
    super(props);
    this.state = {}    
  }

  goToVideo () {
    window.location.href = "https://www.youtube.com/watch?v=CuUXdQI5LLs";
  }

  render() {
   
    return (
      <div className="spacing">
        <a 
            href="https://www.youtube.com/watch?v=CuUXdQI5LLs" 
            rel="noopener noreferrer" target="_blank"
        >Click here to refresh your CPR knowledge</a>
        <Button onClick={this.goToVideo()} variant="primary" size="lg" active></Button>
      </div>
    );
  }
}
